import React from 'react';
import './../App.css';
import { Link } from 'react-router-dom';

function About() {
    return (
        <div className="page-style">
            <p>Developer</p>
            <h1><Link to={`/members/61`}>Ravindra Desai</Link></h1>
            <p>Supporters</p>
            <h1><Link to={`/members/61`}>Ravindra Desai</Link></h1>
        </div>
    )
}

export default About;
